export const GET_ALL_DOGS = 'GET_ALL_POSTS';


export function getAllDogs(){
    return async function (dispatch){
        fetch('localhost:3001/dogs')
        .then(response =>response.json())
        .then(json => dispatch({type:GET_ALL_DOGS,payload:json}))
    }
}
